script: |
  super -f text -I q6951.spq | sort > q6951.out

inputs:
  - name: q6951.spq
    data: |
      SELECT - col0 / 53 - + col0 FROM tab0 (FORMAT parquet) WHERE NOT ( CAST ( + - CAST ( NULL AS INTEGER ) AS INTEGER ) / col0 / + 54 - 88 + CAST ( - 99 - col0 AS INTEGER ) * - col1 ) NOT BETWEEN col2 * - ( - col0 ) - col1 AND col2 + + 51;
  - name: tab0

outputs:
  - name: q6951.out
    data: |
